import{GithubApi}from"./api.min.js";async function projectsList(){const t=document.querySelector("#project-list"),e=new GithubApi,i=await e.repos();i.map(e=>{if(e.homepage){const i=document.createElement("div");i.innerHTML=`
                <h3>${e.name}</h3>
                <p>${e.description}</p>
                <div class="link-container">
                    <a href="${e.homepage}">Visualizar projeto</a>
                    <a href="${e.html_url}">Repositorio</a>
                </div>
            `,i.classList.add("project-box"),t.appendChild(i)}})}export{projectsList};